const initState = {}

const authReducer = (state = initState,action) => {
    switch (action.type){
        case  'LOGIN' :
            console.log('created project' ,action.project);
            return state;

        case 'CREATE_PROJECT_ERROR':
            console.log('created project error' ,action.err);
            return state;
        default :
            return state;
    }
}

export default authReducer
